import { useParams } from "react-router-dom";

function Detail({ notesAll, setNotes }) {
  const { id } = useParams();
  const note = notesAll.find((note) => note.id === id);

  if (!note) {
    return <div>Detail not found</div>;
  }

  // Render detail catatan di sini
  return (
    <div className="note-detail">
      <h2>{note.title}</h2>
      <p>{note.content}</p>
      {/* Tambahkan elemen lainnya yang Anda butuhkan */}
    </div>
  );
}

export default Detail;
